export default states = [
    {
      name: 'app',
      url:"/",
      component: null,
      redirectTo: "app.main",
    },
    {
      name: 'app.main',
      url:"main",
      component: null,
    },
    {
      name: 'app.categories',
      url:"categories",
      component: null,
    },
    {
      name: 'app.settings',
      url:"settings",
      component: null,
    }
  ]
